const NotFound = () => (
    <div>
      <h1 className="Notfound">Niestety zabładziłeś, na pewno tego szukales?</h1>
      <p>Upewnij się, że wpisałeś poprawny adres URL <img
          src="https://upload.wikimedia.org/wikipedia/commons/4/4e/Gmail_Icon.png"
          alt="Instagram"
          style={{ width: "30px", height: "30px" }}
        /></p>
    </div>
  );
  
  export default NotFound;
